import { activityTypes } from '../../utils/variables';
import RecordListItem from '../RecordListItem/RecordListItem';

function RecordList() {

    const { runningRecords,
        swimmingRecords,
        cyclingRecords,
        triathlonRecords } = useContext(RecordsContext);

